import { Row, Col, Avatar
  ,Image} from "antd";
import React from "react";
import Story from "../../components/Story";

export default function Home() {
  return (
    <div style={{ backgroundColor: "transparent", height: 1000 }}>
      <Row>
        <Col span={24}>
          <Story />
        </Col>
      </Row>

      <Row style={{margin: '20px 0'}}>
        <Col span={24}>
          <div style={{display: 'flex'}}>
          <Avatar style={{ width: 40, height: 40 }} src={<Image src="https://joeschmoe.io/api/v1/random" style={{ width: 40 }} />} />
          </div>
        </Col>
      </Row>
    </div>
  );
}
